    "# Crear una nueva columna en df_real con la etiqueta 'Real Power' para diferenciarla\n",
    "df_real['Type'] = 'Real Power'\n",
    "df_forecast['Type'] = 'Predicted Power'\n",
    "\n",
    "# Unir ambos DataFrames (df_real y df_forecast) en uno solo para el gráfico\n",
    "df_combined = pd.concat([df_real[['Date + Time', 'Power [kW]', 'Type']],\n",
    "                         df_forecast[['Date + Time', 'Predicted Power [kW]', 'Type']].rename(columns={'Predicted Power [kW]': 'Power [kW]'})])\n",
