    "# Crear la figura con los datos combinados\n",
    "fig = px.line(df_combined, x='Date + Time', y='Power [kW]', color='Type',\n",
    "              title=\"Predicciones vs Resultados Reales de Potencia [kW]\",\n",
    "              labels={\"Power [kW]\": \"Potencia [kW]\", \"Date + Time\": \"Fecha y Hora\"})\n",
    "\n",
    "# Mostrar el gráfico\n",
    "fig.show()"
