    "# Load models\n",
    "lr_model = load(\"LR_model.sav\")\n",
    "rf_model = load(\"RF_model.sav\")\n",
    "\n",
    "# Load scaler (for RF)\n",
    "with open(\"best_regression_model.plk\", \"rb\") as f:\n",
    "    scaler, _ = pickle.load(f)\n",
    "\n",
    "# Load real data\n",
    "df_real = pd.read_csv('Central_Building_REAL_2019.csv')\n",
    "df_real['Date + Time'] = pd.to_datetime(df_real['Date + Time'])\n",
    "df_real = df_real.sort_values('Date + Time').reset_index(drop=True)\n",
    "\n",
    "# Create features\n",
    "df_real['Previous_hour'] = df_real['Power [kW]'].shift(1)\n",
    "df_real['hour'] = df_real['Date + Time'].dt.hour\n",
    "df_real['Sin_hour'] = np.sin(2 * np.pi * df_real['hour'] / 24)\n",
    "df_real = df_real.dropna().reset_index(drop=True)\n",
    "\n",
    "# Build test set (last 1000 data points)\n",
    "split_point = len(df_real) - 1000\n",
    "test_df = df_real.iloc[split_point:]\n",
    "X_test = test_df[['Previous_hour', 'Sin_hour']].values\n",
    "y_test = test_df['Power [kW]'].values\n",
    "fechas_test = test_df['Date + Time'].values\n",
    "\n",
    "# Predictions\n",
    "predictions_lr = lr_model.predict(X_test)\n",
    "predictions_rf = rf_model.predict(scaler.transform(X_test))\n",
    "\n",
    "# DataFrame for plotting and metrics\n",
    "predictions_df = pd.DataFrame({\n",
    "    'Date + Time': fechas_test,\n",
    "    'LR_Prediction': predictions_lr,\n",
    "    'RF_Prediction': predictions_rf,\n",
    "    'Real': y_test\n",
    "})\n",
    "predictions_df.set_index('Date + Time', inplace=True)\n",
    "\n",
    "# Metrics\n",
    "def get_metrics(y_true, y_pred):\n",
    "    mae = mean_absolute_error(y_true, y_pred)\n",
    "    mse = mean_squared_error(y_true, y_pred)\n",
    "    rmse = np.sqrt(mse)\n",
    "    return round(mae, 3), round(mse, 3), round(rmse, 3)\n",
    "\n",
    "\n",
    "mae_lr, mse_lr, rmse_lr = get_metrics(predictions_df['Real'], predictions_df['LR_Prediction'])\n",
