    "        dcc.Tab(label='Manual Prediction', value='tab-manual'),\n",
    "        dcc.Tab(label='Raw Data', value='tab-raw')  # <-- Add this line to include the \"Raw Data\" tab\n",
    "    ]),\n",
    "\n",
    "    html.Div(id='tabs-content', style={'padding': '30px'})\n",
    "])\n",
    "\n",
    "\n",
    "@app.callback(\n",
    "    Output('tabs-content', 'children'),\n",
    "    [Input('main-tabs', 'value')]\n",
    ")\n",
    "def render_tab_content(tab):\n",
    "    if tab == 'tab-forecast':\n",
    "        return html.Div([\n",
    "            dcc.Dropdown(\n",
    "                id='chart-type-dropdown',\n",
    "                options=[\n",
    "                    {'label': 'Line Chart', 'value': 'line'},\n",
    "                    {'label': 'Scatter Plot', 'value': 'scatter'},\n",
    "                    {'label': 'Absolute Error Plot', 'value': 'error'}\n",
    "                ],\n",
    "                value='line',  # default value\n",
    "                style={'width': '50%', 'margin': '20px auto'}\n",
    "            ),\n",
    "            dcc.Graph(id='model-comparison-graph')\n",
    "        ])\n",
    "\n",
    "    elif tab == 'tab-models':\n",
    "        return html.Div([\n",
    "            html.H3(\"Predictive Model Comparison\", style={'textAlign': 'center'}),\n",
    "            dash_table.DataTable(\n",
    "                id='metrics-table',\n",
    "                columns=[\n",
    "                    {'name': 'Metric', 'id': 'metric'},\n",
    "                    {'name': 'Linear Regression', 'id': 'LR'},\n",
    "                    {'name': 'Random Forest', 'id': 'RF'}\n",
    "                ],\n",
    "                data=[\n",
    "                    {'metric': 'MAE', 'LR': mae_lr, 'RF': mae_rf},\n",
    "                    {'metric': 'MSE', 'LR': mse_lr, 'RF': mse_rf},\n",
    "                    {'metric': 'RMSE', 'LR': rmse_lr, 'RF': rmse_rf}\n",
    "                ],\n",
    "                style_table={'overflowX': 'auto'},\n",
    "                style_cell={'textAlign': 'center'}\n",
    "            )\n",
    "        ])\n",
    "\n",
    "    elif tab == 'tab-manual':\n",
    "        return html.Div([\n",
    "            html.H3(\"Manual Prediction\", style={'textAlign': 'center'}),\n",
    "            dbc.Row([\n",
    "                dbc.Col([\n",
    "                    html.Label(\"Previous Hour Power (kW)\"),\n",
    "                    dcc.Input(id='prev-power', type='number', value=0),\n",
    "                    html.Label(\"Hour (24h format)\"),\n",
    "                    dcc.Input(id='hour', type='number', min=0, max=23, value=12),\n",
    "                ], width=6),\n",
    "\n",
    "                dbc.Col([\n",
    "                    html.Br(),\n",
    "                    html.Button('Calculate Prediction', id='predict-button',\n",
    "                                style={'backgroundColor': '#4CAF50', 'color': 'white', 'padding': '10px 20px'})\n",
    "                ], width=6)\n",
    "            ]),\n",
    "            html.Div(id='prediction-output', style={'marginTop': '30px', 'fontSize': '20px', 'textAlign': 'center'})\n",
    "        ])\n",
    "\n",
    "    elif tab == 'tab-raw':  # Raw Data Tab\n",
    "        return html.Div([\n",
    "            html.H3(\"Raw Data Preview\", style={'textAlign': 'center'}),\n",
    "            html.Div([\n",
    "                dash_table.DataTable(\n",
    "                    id='raw-data-table',\n",
    "                    columns=[\n",
    "                        {'name': col, 'id': col} for col in df_raw.columns\n",
    "                    ],\n",
    "                    data=df_raw.to_dict('records'),\n",
    "                    style_table={'overflowX': 'auto'},\n",
    "                    style_cell={'textAlign': 'center'}\n",
    "                )\n",
    "            ], style={'marginTop': '30px'})\n",
    "        ])\n",
    "\n",
    "\n",
    "@app.callback(\n",
    "    Output('model-comparison-graph', 'figure'),\n",
    "    [Input('chart-type-dropdown', 'value')]\n",
    ")\n",
    "def update_graph(chart_type):\n",
    "    if chart_type == 'line':\n",
    "        fig = go.Figure()\n",
    "        fig.add_trace(go.Scatter(x=predictions_df.index, y=predictions_df['Real'], name='Real'))\n",
    "        fig.add_trace(go.Scatter(x=predictions_df.index, y=predictions_df['LR_Prediction'], name='LR'))\n",
    "        fig.add_trace(go.Scatter(x=predictions_df.index, y=predictions_df['RF_Prediction'], name='RF'))\n",
    "        fig.update_layout(title='Predictions vs Real Data', xaxis_title='Date', yaxis_title='Power (kW)')\n",
    "        return fig\n",
    "\n",
    "    elif chart_type == 'scatter':\n",
    "        fig = go.Figure()\n",
    "        fig.add_trace(go.Scatter(x=predictions_df['Real'], y=predictions_df['LR_Prediction'], mode='markers', name='LR',\n",
    "                                 marker=dict(color='green')))\n",
    "        fig.add_trace(go.Scatter(x=predictions_df['Real'], y=predictions_df['RF_Prediction'], mode='markers', name='RF',\n",
    "                                 marker=dict(color='orange')))\n",
    "        fig.add_trace(go.Scatter(x=[predictions_df['Real'].min(), predictions_df['Real'].max()],\n",
    "                                 y=[predictions_df['Real'].min(), predictions_df['Real'].max()],\n",
    "                                 mode='lines', name='Ideal', line=dict(dash='dash', color='red')))\n",
    "        fig.update_layout(title='Real vs Predicted (LR and RF)', xaxis_title='Power Real [kW]',\n",
    "                          yaxis_title='Power Predicted [kW]')\n",
    "        return fig\n",
    "\n",
    "    elif chart_type == 'error':\n",
    "        fig = go.Figure()\n",
    "        fig.add_trace(\n",
    "            go.Scatter(x=predictions_df.index, y=abs(predictions_df['Real'] - predictions_df['LR_Prediction']),\n",
    "                       name='Absolute Error LR', line=dict(color='green')))\n",
    "        fig.add_trace(\n",
    "            go.Scatter(x=predictions_df.index, y=abs(predictions_df['Real'] - predictions_df['RF_Prediction']),\n",
    "                       name='Absolute Error RF', line=dict(color='orange')))\n",
    "        fig.update_layout(title='Absolute Error by Model', yaxis_title='Error (kW)', xaxis_title='Date')\n",
    "        return fig\n",
    "\n",
    "\n",
    "@app.callback(\n",
    "    Output('prediction-output', 'children'),\n",
    "    [Input('predict-button', 'n_clicks')],\n",
    "    [State('prev-power', 'value'), State('hour', 'value')]\n",
    ")\n",
    "def predict_power(n_clicks, prev_power, hour):\n",
    "    if n_clicks is None:\n",
    "        return \"\"\n",
    "\n",
    "    sin_hour = np.sin(2 * np.pi * hour / 24)\n",
    "    input_data = [[prev_power, sin_hour]]\n",
    "\n",
    "    lr_pred = lr_model.predict(input_data)[0]\n",
    "    rf_pred = rf_model.predict(input_data)[0]\n",
    "\n",
    "    return f'''\n",
    "        Linear Regression Prediction: {lr_pred:.2f} kW\n",
    "        Random Forest Prediction: {rf_pred:.2f} kW\n",
    "    '''\n",
    "\n",
    "\n",
    "if __name__ == '__main__':\n",
    "    app.run(debug=True)\n",
    "\n"
